// src/components/About.js
import React from 'react';
import './About.css';  // Import the CSS file for additional About component styling

function About() {
  return (
    <div className="about-container">
      <h1>About Us</h1>
      <p>
        Welcome to our company! We are committed to providing the best service in the industry.
      </p>
      <p>
        Our team of experts is dedicated to ensuring your satisfaction. We believe in the power of
        collaboration and innovation to drive progress and achieve great results.
      </p>
      <img
        src="https://via.placeholder.com/800x400"
        alt="About Us"
        className="about-us-image"
      />
    </div>
  );
}

export default About;
